import React from "react";
import styled from "styled-components";

const Nav = styled.section`
  width: 100vw;
  height: 5vh;
  position: relative;

  display: flex;
  justify-content: flex-end;
  align-items: center;

  background-color: #282828;
`;

export const Navbar = () => {
  return (
    <Nav>
      <a>Navbar</a>
      <a>Navbar</a>
      <a>Navbar</a>
    </Nav>
  );
};
